import FooterTop from "../components/Footer/Top";
import FooterBottom from "../components/Footer/Bottom";
import "../assets/scss/footer/footer.scss";

const Footer = () => {
  return (
    <footer className="footer">
      <FooterTop />
      <FooterBottom />
    </footer>
  );
};

export default Footer;
